import React, { Fragment } from "react";
import { Card } from "antd";
import Slider from "react-slick";
import "./style.css";
import "antd/dist/antd.css";

const settings = {
    dots: true,
    infinite: true,
    slidesToShow: 3,
    slidesToScroll: 1,
    vertical: true,
    verticalSwiping: true,
    beforeChange: function(currentSlide, nextSlide) {
      console.log("before change", currentSlide, nextSlide);
    },
    afterChange: function(currentSlide) {
      console.log("after change", currentSlide);
    }
  };

export default () => {
  return (
    <Fragment>
      <div className="newPosition">
        <div className="newPosition-content">
          <div className="newPosition-list">
            <Card title="最新职位" extra="更多" bodyStyle={{ padding: 0 }}>
              <Slider autoplay slidesToShow={3} vertical={true} verticalSwiping={true} infinite={true}>
                <h3>1</h3>
                <h3>2</h3>
                <h3>3</h3>
                <h3>4</h3>
              </Slider>
            </Card>
          </div>
        </div>
      </div>
    </Fragment>
  );
};
